import React, { useState } from 'react';
import { Box, Typography, Button } from '@mui/material';
import PredictionResult from './PredictionResult';

const ManualInput = () => {
  const [experiences, setExperiences] = useState([{
    company: '',
    position: '',
    startDate: '',
    endDate: ''
  }]);
  const [selectedModel, setSelectedModel] = useState('');
  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleAddExperience = () => {
    setExperiences([...experiences, {
      company: '',
      position: '',
      startDate: '',
      endDate: ''
    }]);
  };

  const handleRemoveExperience = (index) => {
    if (experiences.length > 1) {
      const newExperiences = experiences.filter((_, i) => i !== index);
      setExperiences(newExperiences);
    }
  };

  const handleExperienceChange = (index, field, value) => {
    const newExperiences = [...experiences];
    newExperiences[index] = {
      ...newExperiences[index],
      [field]: value
    };
    setExperiences(newExperiences);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setPrediction(null);

    try {
      const formData = {
        experiences: experiences.map(exp => ({
          company: exp.company,
          position: exp.position,
          startDate: exp.startDate,
          endDate: exp.endDate || null
        })),
        modelType: selectedModel.toLowerCase()
      };

      const response = await fetch('/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.error || 'Fehler bei der Vorhersage');
      }

      const data = await response.json();
      setPrediction(data);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box className="content-container" sx={{ ml: '280px', py: 5, pr: 5, pl: 10 }}>
      <Box className="header-section" sx={{ pb: 2.5, mb: 5 }}>
        <Box className="settings-header" sx={{ maxWidth: '1200px' }}>
          <Typography
            variant="h1"
            sx={{
              fontSize: '2.5rem',
              fontWeight: 700,
              color: '#001B41',
              mb: 2.5,
              letterSpacing: '-0.5px'
            }}
          >
            Karriere-Prognose
          </Typography>
          <Box className="settings-info" sx={{ mb: 2.5 }}>
            <Typography
              className="info-description"
              sx={{
                fontSize: '1.1rem',
                color: '#666',
                lineHeight: 1.5,
                maxWidth: '600px'
              }}
            >
              Analysieren Sie die Wechselwahrscheinlichkeit eines einzelnen Kandidaten basierend auf dessen Berufserfahrung.
            </Typography>
          </Box>
        </Box>
      </Box>

      <Box 
        component="form" 
        onSubmit={handleSubmit} 
        className="pers-form"
        sx={{ maxWidth: '1200px', width: '100%', pr: 5 }}
      >
        <Box 
          className="form-group"
          sx={{
            bgcolor: 'white',
            p: '30px',
            borderRadius: '16px',
            boxShadow: '0 8px 25px rgba(0, 0, 0, 0.1)',
            mb: '30px',
            width: 'calc(100% - 40px)'
          }}
        >
          <Typography
            variant="h3"
            sx={{
              color: '#001B41',
              fontSize: '1.5rem',
              mb: 2.5,
              fontWeight: 600
            }}
          >
            Berufserfahrung
          </Typography>

          <Box id="experiences" className="experiences-container">
            {experiences.map((exp, index) => (
              <Box
                key={index}
                className="experience-entry"
                sx={{
                  display: 'grid',
                  gridTemplateColumns: 'repeat(4, 1fr)',
                  gap: '15px',
                  mb: '20px',
                  pb: '20px',
                  borderBottom: index < experiences.length - 1 ? '1px solid rgba(0, 0, 0, 0.1)' : 'none',
                  width: '100%'
                }}
              >
                <input
                  type="text"
                  value={exp.company}
                  onChange={(e) => handleExperienceChange(index, 'company', e.target.value)}
                  placeholder="Firma"
                  style={{
                    width: '100%',
                    padding: '10px 12px',
                    borderRadius: '10px',
                    border: '1px solid #ddd',
                    backgroundColor: 'white',
                    fontSize: '1rem',
                    boxSizing: 'border-box'
                  }}
                />
                <input
                  type="text"
                  value={exp.position}
                  onChange={(e) => handleExperienceChange(index, 'position', e.target.value)}
                  placeholder="Position"
                  style={{
                    width: '100%',
                    padding: '10px 12px',
                    borderRadius: '10px',
                    border: '1px solid #ddd',
                    backgroundColor: 'white',
                    fontSize: '1rem',
                    boxSizing: 'border-box'
                  }}
                />
                <input
                  type="date"
                  value={exp.startDate}
                  onChange={(e) => handleExperienceChange(index, 'startDate', e.target.value)}
                  style={{
                    width: '100%',
                    padding: '10px 12px',
                    borderRadius: '10px',
                    border: '1px solid #ddd',
                    backgroundColor: 'white',
                    fontSize: '1rem',
                    boxSizing: 'border-box'
                  }}
                />
                <input
                  type="date"
                  value={exp.endDate}
                  onChange={(e) => handleExperienceChange(index, 'endDate', e.target.value)}
                  style={{
                    width: '100%',
                    padding: '10px 12px',
                    borderRadius: '10px',
                    border: '1px solid #ddd',
                    backgroundColor: 'white',
                    fontSize: '1rem',
                    boxSizing: 'border-box'
                  }}
                />
                {experiences.length > 1 && (
                  <Button
                    onClick={() => handleRemoveExperience(index)}
                    className="remove-experience"
                    sx={{
                      gridColumn: '1 / -1',
                      width: '120px',
                      marginRight: 'auto',
                      padding: '8px 12px',
                      borderRadius: '8px',
                      border: 'none',
                      bgcolor: '#f8f9fa',
                      color: '#666',
                      fontSize: '0.9rem',
                      cursor: 'pointer',
                      transition: 'all 0.3s ease',
                      '&:hover': {
                        bgcolor: '#dc3545',
                        color: 'white'
                      }
                    }}
                  >
                    Entfernen
                  </Button>
                )}
              </Box>
            ))}
          </Box>

          <Button
            onClick={handleAddExperience}
            className="btn-secondary"
            sx={{
              width: '40%',
              bgcolor: '#001B41',
              color: 'white',
              border: 'none',
              p: '14px',
              borderRadius: '8px',
              fontSize: '1rem',
              fontWeight: 600,
              cursor: 'pointer',
              transition: 'all 0.3s ease',
              display: 'flex',
              '&:hover': {
                bgcolor: '#FF5F00',
                transform: 'translateY(-2px)'
              }
            }}
          >
            Weitere Position hinzufügen
          </Button>
        </Box>

        <Box 
          className="form-group"
          sx={{
            bgcolor: 'white',
            p: '30px',
            borderRadius: '16px',
            boxShadow: '0 8px 25px rgba(0, 0, 0, 0.1)',
            mb: '30px',
            width: 'calc(100% - 40px)'
          }}
        >
          <Typography
            variant="h3"
            sx={{
              color: '#001B41',
              fontSize: '1.5rem',
              mb: 2.5,
              fontWeight: 600
            }}
          >
            KI-Modell
          </Typography>

          <Box className="model-selection" sx={{ mb: 3 }}>
            <select
              value={selectedModel}
              onChange={(e) => setSelectedModel(e.target.value)}
              style={{
                width: '100%',
                padding: '12px',
                fontSize: '1rem',
                border: '1px solid #ddd',
                borderRadius: '10px',
                backgroundColor: 'white',
                cursor: 'pointer'
              }}
            >
              <option value="" disabled>Wählen Sie ein Modell</option>
              <option value="gru">Gated Recurrent Unit (GRU)</option>
              <option value="xgboost">Extreme Gradient Boosting (XGBoost)</option>
              <option value="tft">Temporal Fusion Transformer (TFT)</option>
            </select>
          </Box>

          <Button
            type="submit"
            className="btn-primary"
            disabled={loading}
            sx={{
              width: '60%',
              bgcolor: '#001B41',
              color: 'white',
              border: 'none',
              p: '14px',
              borderRadius: '8px',
              fontSize: '1rem',
              fontWeight: 600,
              cursor: 'pointer',
              transition: 'all 0.3s ease',
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              margin: '0 auto',
              textAlign: 'center',
              '&:hover': {
                bgcolor: '#FF5F00',
                transform: 'translateY(-2px)'
              }
            }}
          >
            {loading ? 'Wird berechnet...' : 'Prognose erstellen'}
          </Button>
        </Box>
      </Box>

      {loading && (
        <Box 
          className="loader-container-prediction"
          sx={{
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            alignItems: 'center',
            height: '150px',
            my: '20px',
            gap: '20px'
          }}
        >
          <Box 
            className="loader-prediction"
            sx={{
              border: '4px solid #f3f3f3',
              borderTop: '4px solid #FF5F00',
              borderRadius: '50%',
              width: '40px',
              height: '40px',
              animation: 'spin 1s linear infinite',
              '@keyframes spin': {
                '0%': { transform: 'rotate(0deg)' },
                '100%': { transform: 'rotate(360deg)' }
              }
            }}
          />
          <Typography
            className="loader-status"
            sx={{
              color: '#001B41',
              fontSize: '1.1rem',
              fontWeight: 500,
              textAlign: 'center'
            }}
          >
            Prognose wird erstellt...
          </Typography>
        </Box>
      )}

      {error && (
        <Box
          sx={{
            bgcolor: '#fff3f3',
            border: '1px solid #ffcdd2',
            borderRadius: 2,
            p: 3,
            my: 3,
            maxWidth: '1200px'
          }}
        >
          <Typography variant="h6" sx={{ color: '#dc3545', mb: 1 }}>
            Fehler bei der Verarbeitung
          </Typography>
          <Typography>{error}</Typography>
        </Box>
      )}

      {prediction && <PredictionResult prediction={prediction} />}
    </Box>
  );
};

export default ManualInput;
